// src/pages/TrialEnded.js
import React from 'react';
import { Link } from 'react-router-dom';

const TrialEnded = () => {
  return (
    <div style={styles.container}>
      <h1>Your Free Trial Has Ended</h1>
      <p>
        Thank you for trying out AUTOLAWN! Your 7-day free trial has now ended.
        To continue using the application, please upgrade your subscription.
      </p>
      <Link to="/pricing" style={styles.button}>
        Upgrade Now
      </Link>
    </div>
  );
};

const styles = {
  container: {
    textAlign: 'center',
    padding: '50px'
  },
  button: {
    padding: '10px 20px',
    backgroundColor: '#007BFF',
    color: '#fff',
    textDecoration: 'none',
    borderRadius: '5px'
  }
};

export default TrialEnded;
